// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

contract MyContract {
    string public message;

    constructor(string memory _message) {
        message = _message;
    }

    function setMessage(string memory _message) public {
        message = _message;
    }

    struct ConnState {
        uint8 OTH;
        uint8 REJ;
        uint8 RSTO;
        uint8 RSTOS0;
        uint8 RSTR;
        uint8 RSTRH;
        uint8 S0;
        uint8 S1;
        uint8 S2;
        uint8 S3;
        uint8 SF;
        uint8 SH;
        uint8 SHR;
    }

    struct Threat {
        string device_id;
        string threat_type;
        string timestamp;
        uint256 duration;
        uint256 orig_bytes;
        uint256 resp_bytes;
        ConnState conn_state;
    }

    mapping(address => Threat[]) public threats;

    event ThreatRecorded(address indexed device, string threat_type, string timestamp);

    function recordThreat(
        string memory _device_id,
        string memory _threat_type,
        string memory _timestamp,
        uint256 _duration,
        uint256 _orig_bytes,
        uint256 _resp_bytes,
        ConnState memory _conn_state
    ) public {
        require(bytes(_device_id).length > 0, "Device ID is required");
        require(bytes(_threat_type).length > 0, "Threat type is required");
        require(bytes(_timestamp).length > 0, "Timestamp is required");
        require(_duration > 0, "Duration must be greater than 0");
        require(_orig_bytes >= 0, "Original bytes must be non-negative");
        require(_resp_bytes >= 0, "Response bytes must be non-negative");

        Threat memory newThreat = Threat({
            device_id: _device_id,
            threat_type: _threat_type,
            timestamp: _timestamp,
            duration: _duration,
            orig_bytes: _orig_bytes,
            resp_bytes: _resp_bytes,
            conn_state: _conn_state
        });

        threats[msg.sender].push(newThreat);

        emit ThreatRecorded(msg.sender, _threat_type, _timestamp);
    }

    function getThreats(address _device) public view returns (Threat[] memory) {
        return threats[_device];
    }
}
